import { defineConfig } from 'father';

export default defineConfig({
  cjs: {
    output: 'dist',
  },
});

module.exports = {
  printWidth: 80,
  singleQuote: true,
  trailingComma: "all",
  proseWrap: "never",
  overrides: [{ files: ".prettierrc", options: { parser: "json" } }],
  plugins: [
    require.resolve("prettier-plugin-packagejson"),
    require.resolve("./scripts/prettier-plugin"),
  ],
};

export default {
  favicons: [
    'https://img.alicdn.com/tfs/TB1YHEpwUT1gK0jSZFhXXaAtVXa-28-27.svg',
  ],
  mfsu: { strategy: 'normal' },
  routePrefetch: {},
  manifest: {},
  plugins: ['@umijs/plugin-docs'],
  conventionRoutes: {
    exclude: [/\/components\//],
  },
};

// Redirect /zh-CN to /
if (location.pathname.startsWith('/zh-CN')) {
  location.href = `https://v3.umijs.org${location.pathname}`;
}

import { Config, createConfig } from 'umi/test';

export default {
  ...createConfig(),
  testMatch: ['<rootDir>/packages/*/src/**/*.test.ts'],
  modulePathIgnorePatterns: [
    '<rootDir>/packages/.+/compiled',
    '<rootDir>/packages/.+/fixtures',
  ],
  transformIgnorePatterns: ['/node_modules/', '/compiled/'],
  collectCoverageFrom: [
    '**/src/**/*.{ts,tsx}',
    '!**/examples/**/*.{js,jsx,ts,tsx}',
    '!**/compiled/**/*.{js,jsx}',
    '!**/fixtures/**/*.*',
    '!packages/create-umi/templates/**/*.*',
  ],
} as Config.InitialOptions;

import { Config, createConfig } from 'umi/test';

export default {
  ...createConfig(),
  preset: 'jest-playwright-preset',
  setupFilesAfterEnv: ['expect-playwright'],
  testMatch: ['**/*.e2e.ts'],
  modulePathIgnorePatterns: [
    '<rootDir>/packages/.+/compiled',
    '<rootDir>/packages/.+/fixtures',
    '<rootDir>/test/.+/fixtures',
  ],
  moduleNameMapper: {
    'test-utils': '<rootDir>/test/lib/testUtils.ts',
  },
} as Config.InitialOptions;

import { Config, createConfig } from 'umi/test';

const cwd = process.cwd();

export default {
  ...createConfig(),
  rootDir: cwd,
  testMatch: ['<rootDir>/src/**/*.test.ts'],
  modulePathIgnorePatterns: [
    '<rootDir>/compiled',
    '<rootDir>/fixtures',
    '<rootDir>/bundles',
  ],
  transformIgnorePatterns: ['/node_modules/', '/compiled/'],
  cacheDirectory: `${cwd}/.jest-cache`,
} as Config.InitialOptions;

{
  "version": "4.4.4",
  "workspaces": ["packages/*"]
}

{
  "extends": "./tsconfig.base.json",
  "compilerOptions": {
    "baseUrl": ".",
    "paths": {
      "@/*": ["*"],
      "@@/*": [".umi/*"],
      "test-utils": ["test/lib/testUtils"],
      "umi": ["./packages/umi"],
      "@umijs/utils": ["./packages/utils"],
      "@umijs/renderer-react": ["./packages/renderer-react"]
    }
  }
}

{
  "$schema": "https://turborepo.org/schema.json",
  "baseBranch": "origin/master",
  "pipeline": {
    "build": {
      "dependsOn": ["^build"],
      "outputs": ["dist/**"]
    },
    "build:extra": {
      "cache": false
    },
    "dev": {
      "cache": false
    },
    "test": {
      "outputs": [".jest-cache/**"]
    }
  },
  "globalDependencies": [
    "tsconfig.base.json",
    "tsconfig.json",
    "jest.config.ts",
    ".father.base.ts"
  ]
}

declare module '*.png' {
  const src: string
  export default src
}

declare module '*.svg' {
  const src: string
  export default src
}
